    // useLocation and or useRef/Routematch? idk
    const location = props.username ? 'user' : 'results'
    const id = props.username ? userId : resultId

    return(
        <div onClick={() => getSelection(id)}>
            <Link to={`/${location}/${id}`}> 
                {username || title}
            </Link>
            { mood }
        </div>
    )
}
